import React from "react";
import "./navbar.css";
// import icons from "./download/menu.svg";

class Navbar extends React.Component {
   constructor() {
      super();
      this.state = {
         isMenu: false,
      };
   }
   render() {
      return (
         <div className="Navbar_wapp">
            <div className="logo">
               <h2>
                  <a href="#home">Sivaramakrishnan</a>
               </h2>
            </div>
            <nav
               className={`navbar_mobile ${this.state.isMenu ? "isMenu_on" : "isMenu_off"
                  }`}
            >
               <ul>
                  <li
                     onClick={() => {
                        this.setState({ isMenu: !this.state.isMenu });
                     }}
                  >
                     <a href="#home">
                        <i className="fas fa-home"></i>Home
                     </a>
                  </li>
                  {/* <li><a href="#about">About</a></li> */}
                  <li
                     onClick={() => {
                        this.setState({ isMenu: !this.state.isMenu });
                     }}
                  >
                     <a href="#skills">
                        <i className="fas fa-graduation-cap"></i>Skills
                     </a>
                  </li>
                  <li
                     onClick={() => {
                        this.setState({ isMenu: !this.state.isMenu });
                     }}
                  >
                     <a href="#work">
                        <i className="fas fa-desktop"></i>Work
                     </a>
                  </li>
                  <li
                     onClick={() => {
                        this.setState({ isMenu: !this.state.isMenu });
                     }}
                  >
                     <a href="#contact">
                        <i className="fas fa-user"></i>Contact
                     </a>
                  </li>
                  <li
                     className="login"
                     onClick={() => {
                        this.setState({ isMenu: !this.state.isMenu });
                     }}
                  >
                     <a href="#login">Login</a>
                  </li>
               </ul>
            </nav>
            <div
               className="menu"
               onClick={() => {
                  this.setState({ isMenu: !this.state.isMenu });
               }}
            >
               <i className="fas fa-bars"></i>
            </div>
         </div>
      );
   }
}

export default Navbar;
